summary.raw:
{
  "personalized_overall": "rlas님은 외부 세계와의 접촉에 대한 갈망이 있으며, 동시에 심리적인 거리감을 느끼고 있는 것으로 보입니다 (창문·문). 이는 개방성과 수줍음이 공존하는 상태를 나타냅니다. 또한, 환경에 대한 불만족이 존재할 가능성이 있으며 (가지), 이는 좌절감을 유발할 수 있습니다. 자신감과 야망이 있지만 (수관), 약한 자아로 인한 불안감이 느껴질 수 있습니다 (기둥). 이러한 요소들은 rlas님이 대인관계에서 갈등을 회피하고자 하는 경향을 시사합니다 (작은 얼굴).",
  "strengths": [
    "개방성과 외부와의 접촉에 대한 갈망 (창문)",
    "자신감과 야망 (수관)",
    "환경에 대한 성취 능력 (가지)"
  ],
  "cautions": [
    "자기통제력이 약할 가능성이 있음 (비정상적인 지붕)",
    "대인관계의 갈등을 회피하려는 경향이 있음 (작은 얼굴)",
    "환경에 대한 불만족으로 인한 좌절감이 존재할 수 있음 (가지)"
  ],
  "per_drawing": {
    "house": "창문이 여러 개인 경우, 개방성과 외부와의 접촉에 대한 갈망이 드러납니다.",
    "tree": "가지가 적은 것은 환경에 만족하지 못하여 좌절하고 있음을 시사함.",
    "person": "아주 작은 얼굴의 경우 매우 약한 자아의 강도를 나타냅니다."
  }
}

{
  "personalized_overall": "ㅁㄴㅇ님은 현실과의 접촉을 꺼리는 경향이 있으며, 이는 우유부단함과 사회성의 결핍을 나타냅니다 (문). 또한, 강한 애정욕구와 의존성을 가지고 있지만, 이러한 욕구가 좌절될 경우 무력감을 느낄 수 있습니다 (태양). 자신감과 야망이 있으며, 정열적으로 몰두하는 성향이 있습니다 (수관). 그러나 자기통제력이 약할 수 있는 요소도 존재합니다 (지붕).",
  "strengths": [
    "자신감과 야망이 있음 (수관)",
    "정열적으로 몰두하는 성향 (수관)",
    "타인과의 접촉에 대한 균형 잡힌 통제력 (길)"
  ],
  "cautions": [
    "현실 도피 경향이 있을 가능성이 있음",
    "사회성의 결핍이 우려됨",
    "자기통제력이 약할 수 있음"
  ],
  "per_drawing": {
    "house": "환경과의 접촉을 꺼리는 경향이 있으며, 우유부단함과 무력감을 나타냄.",
    "tree": "의존욕구와 부모의 애정에 대한 갈망을 표현할 수 있음.",
    "person": "내향적인 경향과 자기도취를 나타낼 수 있음."
  }
}

{
  "personalized_overall": "d님은 외부 세계와의 접촉에 대한 갈망이 강하게 나타나며, 현실과의 접촉이 적은 경향이 있습니다 (창문). 또한, 자기통제력이 약할 수 있는 가능성이 있으며 (지붕), 주변 환경에서 만족을 얻기 위해 지나친 노력을 하는 경향이 있을 수 있습니다 (가지). 이러한 특성은 대인 관계에서의 불안정함과 갈등을 시사합니다.",
  "strengths": [
    "개방성과 외부와의 접촉을 갈망하는 능력 (창문)",
