{
  "personalized_overall": "이미연님은 환경과의 접촉을 꺼리고 우유부단함이 나타나며(문), 현실 도피와 사회성 결핍을 경험하고 있습니다. 자기통제력이 약할 가능성이 있으며(지붕), 타인과의 접촉에서 균형 잡힌 통제력을 유지하려고 합니다(길). 만족을 공상에서 찾고 현실과의 접촉이 적은 경향이 보입니다(집벽). 자신감과 야망이 있으며(수관), 대인관계에서 갈등을 회피하고자 하는 마음이 내포되어 있습니다(얼굴).",
