{
  "personalized_overall": "the님은 외부 세계와의 접촉에 대한 갈망이 있으며, 동시에 심리적인 거리감을 느끼고 있습니다 (창문). 현실 도피와 사회적 관계에서의 어려움이 드러나며 (문), 자신이 원하는 바를 성취할 능력이 있다는 자신감도 보입니다 (가지). 그러나 환경에 대한 불만족이 좌절감을 유발할 가능성이 있으며 (가지), 대인관계에서의 갈등을 회피하고자 하는 마음이 내포되어 있습니다 (얼굴).",
