{
  "personalized_overall": "ㄱㄹ님은 다양한 요소를 통해 자신을 표현하고자 하는 경향이 있습니다. 특히, 집과 나무를 통해 안정감과 성장에 대한 욕구를 나타내고 있습니다 (창문·문, 가지). 이러한 요소들은 ㄱㄹ님이 주변 환경과의 관계를 중시하며, 자신을 둘러싼 세계에 대한 관심이 깊음을 시사합니다. 또한, 사람을 그린 점은 대인관계에 대한 중요성을 강조하고 있습니다 (사람). 전반적으로 ㄱㄹ님은 내면의 세계와 외부 환경 간의 상호작용을 탐구하는 성향이 있습니다.",
  "strengths": [
    "환경에 대한 관심이 높음 (창문·문)",
    "대인관계의 중요성을 인식함 (사람)",
    "안정감을 추구함 (가지)"
  ],
  "cautions": [
    "자신의 감정을 표현하는 데 어려움이 있을 가능성이 있다.",
    "주변 환경에 대한 지나친 의존이 우려될 수 있다."
  ],
  "per_drawing": {
    "house": "안정감과 보호를 상징함.",
    "tree": "성장과 발전의 상징으로 해석됨.",
    "person": "대인관계의 중요성을 나타냄."
  }
}
